import React from "react";
import ReactDOM from "react-dom";

const Header = (props) => {
  return <h1>{props.course}</h1>;
};

const Content = (props) => {
  return (
    <>
      <Part name={parts[0].name} ex={parts[0].exercises}></Part>
      <Part name={parts[1].name} ex={parts[1].exercises}></Part>
      <Part name={parts[2].name} ex={parts[2].exercises}></Part>
    </>
  );
};
const Part = (props) => {
  return (
    <div>
      {props.name} {props.ex}{" "}
    </div>
  );
};
const Total = (props) => {
  return <>Total number of excercises: {props.e1 + props.e2 + props.e3}</>;
};
const App = () => {
  const course = "Half Stack application development";

  const parts = [
    {
      name: "Fundamentals of React",
      exercises: 10,
    },
    {
      name: "Using props to pass data",
      exercises: 7,
    },
    {
      name: "State of a component",
      exercises: 14,
    },
  ];
  console.log(parts[0].name);
  return (
    <div>
      <Header course={course} />
      <p></p>{" "}
      <p>
        <Content part2Name={parts[1].name} part2Ex={parts[1].exercises} />
      </p>
      <p>
        <Content part3Name={parts[2].name} part3Ex={parts[2].exercises} />
      </p>{" "}
      <p>
        <Total
          e1={parts[0].exercises}
          e2={parts[1].exercises}
          e3={parts[2].exercises}
        ></Total>
      </p>
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById("root"));
